import logo from './logo.svg';
import './App.css';
//Bootstrap CSS
import 'bootstrap/dist/css/bootstrap.min.css';
//Router Import
import { Route } from 'react-router-dom';
//Pages Imports
import Home from "./Pages/home";

function App() {
  return (
    <div>
        <Route path='/' exact>
          <Home />
        </Route>
    </div>
  );
}

export default App;
